import React from 'react';
import { useParams } from 'react-router-dom';

function ThankYouPage() {
  const { fullName, stdid, level,subj,about} = useParams();

  return (
    <div>
      <h1>ขอบคุณที่สมัคร!</h1>
      <p>ชื่อ-สกุล: {fullName}</p>
      <p>รหัสนักศึกษา: {stdid}</p>
      <p>รหัสนักศึกษา: {level}</p>
      <p>รหัสนักศึกษา: {subj}</p>
      <p>รหัสนักศึกษา: {about}</p>
      {/* แสดงข้อมูลอื่นๆ ตามต้องการ */}
    </div>
  );
}

export default showsa;
